function Post(props) {
  const { id, name, capital, population, flag, map } = props;

  return (
    <div className="postArea">
      <div>{name}</div>
      <div>{capital}</div>
      <div>{population}</div>
      <div>
        <img className="flaf" src={flag} />
      </div>
    </div>
  );
}
export default Post;
